from itertools import accumulate#

numbers = "".split('0')


#a = [x for x in numbers if len(x) >= 13]
#big_num_list = []
#[big_num_list.append(x) for x in numbers if x not in big_num_list]

#print(big_num_list)
numbs = []
products = []

for big_num in numbers: #big_num_list:    
    num_list = [int(n) for n in big_num]
    #print(num_list)
    #print(big_num)    
    l = len(str(big_num))
    if l <= 13: 
        numbs.append(num_list[:])
        #print(num_list[:])
    else:
        j = l - 13
        for i in range(j):
            numbs.append(num_list[i:i+13])
            #print(numbs)
    for number in numbs:
        #print(' ',number)
        try:
            product = [*accumulate(number, lambda a, b: a*b)][-1]
            products.append(product)
            #print(' ',product)
        except: 
            products.append(0)
            
print(' ',max(products))

